webpackJsonp([0x74727213ceb7],{1725:function(a,e){a.exports={data:{markdownRemark:{html:'<p>한밤중에 MTV가 TV에 실 렸습니다. "같은 탁자에 섰습니다"라는 인기있는 노래가 들렸습니다. 듣고 듣는 것처럼 보였고, 심지어 어린 시절을 상기 시켰습니다. 그 당시 누가 같은 테이블 이었습니까? "당신은 같은 테이블에 있습니다."와 같은 분위기는 전혀 없다는 인상은 없었습니다. 역사의 그 기간을 방금 걸어온 사람들 만이 엄청난 감정을 가질 것입니다. 모두는이 노래를 좋아하며 "같은 탁자에"당신이 많은 사람들의 마음 속에 존재한다는 것을 보여줍니다. 문제는 언제 "같은 탁자에있는 당신"이 사라졌는가하는 것인데, 대학에있는 "같은 탁자에"당신이 복습하는 시간이 없다는 것입니다. 남자와 여자는 더 이상 "계획되고 비례"하지 않습니다. 때때로 같은 테이블에서 우발적 인 경우가 있습니다. 실수로 테이블에 참가하지 않아도 우연이 아니며 모든 것이 명확합니다. 초등학생과 중학생 인 "같은 탁자에있는 당신"은 대학에 다니지 않습니다. 대학은 그런 난감한 감정적 인 방법을 필요로하지 않으며, 모든 것이 더 직접적이고 심지어 굵은 글씨로 변합니다. 따라서 사람들은 깊이 있고 심지어는 영원히 기억하기 어렵습니다.</p>\n<p>젊은 나이의 감정은 상대적으로 순수하고 사회의 모든 종류의 물질적, 문화적, 삶, 삶, 돈 및 욕망의 영향을받지 않기 때문에 아마도 가장 소중한 것입니다. "당신 같은 테이블에서"에 대한 반응은이 감정의 감정 일 수 있습니다.</p>\n<p>삶을 마치 듯이 양식을 계속 작성하십시오.</p>',id:"/home/swain/workspace/political-life/src/pages/ko/0172.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ko/0172.md",frontmatter:{title:"10월 30일 일요일"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ko/0172.md absPath of file >>> MarkdownRemark"}}}});
